import "./expense.css"

function Expense(){
  return  (
    <div>
         <div className="expense-item">
             <div className='expense-item__description' >20 Nov 2020  </div>
           <div >
               <h1 className='expense-item'>Bike petrol</h1>
           </div>
           <div className="expense-item__price expense-item__price">$1300</div>
         </div>


    </div>  
)}

export default Expense;
